import React from "react";
import { View, Text, TouchableOpacity } from "react-native";
import { Avatar, Badge, Icon, withBadge } from "react-native-elements";
import Icone from "../Configs/Icone";
export default ({ navigation, titulo }) => {
  return (
    <View
      style={{
        flexDirection: "row",
        height: 50,
        backgroundColor: "#574c91",
      }}
    >
      <View
        style={{
          flex: 0.8,
          alignContent: "center",
          justifyContent: "center",
          marginLeft: 5,
        }}
      >
        <TouchableOpacity onPress={() => navigation.openDrawer()}>
          <Icone color="#f28f66" estilo={{ FontSize: 12 }} name="bars" />
        </TouchableOpacity>
      </View>
      <View
        style={{
          flex: 1.5,
          alignContent: "flex-start",
          justifyContent: "center",
        }}
      >
        <Text style={{ color: "#f28f66", fontSize: 20 }}>{titulo}</Text>
      </View>
      <View
        style={{
          flex: 0.2,
          alignContent: "flex-end",
          justifyContent: "center",
        }}
      >
        <TouchableOpacity
          onPress={() => {
            navigation.navigate("TabVagas");
          }}
        >
          <Icone color="#f28f66" estilo={{ FontSize: 12 }} name="bell" />
        </TouchableOpacity>
      </View>
    </View>
  );
};
